import NavBar from '../components/NavBar';
import Footer from '../components/Footer';
import AboutContent from '../components/AboutContent';

function About() {
  return (
    <div>
      <NavBar />
      <AboutContent />
      <Footer />
    </div>
  );
}

export default About;
